import React from 'react';

const EventsPage = () => {
    return (
        <div style={{ textAlign: "center", margin: "20px" }}>
            <h1 style={{ color: "#4caf50" }}>Our Events</h1>
            <p style={{ fontSize: "1.2rem", color: "#555", maxWidth: "800px", margin: "auto" }}>
                We host exciting events that bring joy, learning, and creativity to children. Watch some of our past events below:
            </p>

            {/* Video Container for Responsive Display */}
            <div className="video-container">
                <video controls>
                    <source src="/videos/activity1.mp4" type="video/mp4" />
                    Your browser does not support the video tag.
                </video>
            </div>

            <div className="video-container">
                <video controls>
                    <source src="/videos/event2.mp4" type="video/mp4" />
                    Your browser does not support the video tag.
                </video>
            </div>
        </div>
    );
};

export default EventsPage;
